import React from "react";
import styled from "styled-components";



const CompletedDiv = styled.div`{
cursor: pointer;
color: ${props => props.complete  ? "#865829" :  "white"};
}`


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }
  return (
    <CompletedDiv
      id={track.id}
      name="track"
      value={track.id}
      onClick={handleClick}
      complete={track.complete}
    >
      {track.title}, {track.status.map(status => status)}
    </CompletedDiv >
  );
};

export default Track;
